- uid: "com.google.datastore.admin.v1.ImportEntitiesRequestOrBuilder.getInputUrl()"
  id: "getInputUrl()"
  parent: "com.google.datastore.admin.v1.ImportEntitiesRequestOrBuilder"
  langs:
  - "java"
  name: "getInputUrl()"
  nameWithType: "ImportEntitiesRequestOrBuilder.getInputUrl()"
  fullName: "com.google.datastore.admin.v1.ImportEntitiesRequestOrBuilder.getInputUrl()"
  overload: "com.google.datastore.admin.v1.ImportEntitiesRequestOrBuilder.getInputUrl*"
  type: "Method"
  package: "com.google.datastore.admin.v1"
  summary: "\n Required. The full resource URL of the external storage location.\n Currently, only Google Cloud Storage is supported. So input_url should be\n of the form:\n <code>gs://BUCKET_NAME[/NAMESPACE_PATH]/OVERALL_EXPORT_METADATA_FILE</code>, where\n <code>BUCKET_NAME</code> is the name of the Cloud Storage bucket, <code>NAMESPACE_PATH</code> is\n an optional Cloud Storage namespace path (this is not a Cloud Datastore\n namespace), and <code>OVERALL_EXPORT_METADATA_FILE</code> is the metadata file written\n by the ExportEntities operation. For more information about Cloud Storage\n namespace paths, see\n <a href=\"https://cloud.google.com/storage/docs/naming#object-considerations\">Object name\n considerations</a>.\n\n For more information, see\n <xref uid=\"\" data-throw-if-not-resolved=\"false\">google.datastore.admin.v1.ExportEntitiesResponse.output_url</xref>.\n \n\n <code>string input_url = 3 [(.google.api.field_behavior) = REQUIRED];</code>"
  syntax:
    content: "public abstract String getInputUrl()"
    return:
      type: "java.lang.String"
      description: "The inputUrl."
